import React from 'react';
import './App.css';
// import 'bootstrap/dist/css/bootstrap.min.css';

import { BrowserRouter, Route, Switch } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';

//Pages
import ProfilePage from './pages/ProfilePage/ProfilePage';
import ContentItemPage from './pages/ContentItemPage/ContentItemPage';
import ItemPage2 from './pages/ItemPage2/ItemPage2';
import ItemPage3 from './pages/ItemPage3/ItemPage3';
import UploadItemPage from './pages/UploadItemPage/UploadItemPage';

//Components
import {Navbar} from './components/Navbar/Navbar';





function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Container className="container-1">
        <Row>
            <Col>
              <Navbar />
            </Col>
          </Row>
          <br></br>
          <BrowserRouter>
            <Switch>
              <Route component={ProfilePage} exact path="/profilepage" />
              <Route component={ContentItemPage} exact path="/contentitempage" />
              <Route component={ItemPage2} exact path="/ItemPage2" />
              <Route component={ItemPage3} exact path="/ItemPage3" />
              <Route component={UploadItemPage} exact path="/UploadItemPage" />
            </Switch>
          </BrowserRouter>
        </Container>
      </header>
    </div>
  );
}

export default App;
